import React from 'react';
import './App.css';
import Search from './components/Search';
import {BrowserRouter} from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <Search/>
    </div>
    </BrowserRouter>
  );
}

export default App;
